import './Header.css';


const Header = (props) => {
    return (
        <header className="header">
            <div className="header__username">ПАК1: ЦЭН УГП2 отм. 5.4</div>
            <div className="header__title">ПАК1: ЦЭН УГП2 отм. 5.4</div>
        </header>
    );
};

export default Header;
